import React from 'react';
import Grid from "@material-ui/core/Grid";
import Button from "@material-ui/core/Button";
import {Card, CardContent, CardMedia, IconButton, Paper, useTheme} from "@material-ui/core";
import Typography from "@material-ui/core/Typography";
import * as PropTypes from "prop-types";


const useStyles = makeStyles((theme) => ({
    root: {
        display: 'flex',
    },
    details: {
        display: 'flex',
        flexDirection: 'column',
    },
    content: {
        flex: '1 0 auto',
    },
    cover: {
        width: 151,
    },
    controls: {
        display: 'flex',
        alignItems: 'center',
        paddingLeft: theme.spacing(1),
        paddingBottom: theme.spacing(1),
    },
    playIcon: {
        height: 38,
        width: 38,
    },
}));

class PlayArrowIcon extends React.Component {
    render() {
        return null;
    }
}

PlayArrowIcon.propTypes = {className: PropTypes.string};

class SkipNextIcon extends React.Component {
    render() {
        return null;
    }
}

class SkipPreviousIcon extends React.Component {
    render() {
        return null;
    }
}

const SellerDashboard = () => {
    const classes = useStyles();
    const theme = useTheme();

    const paperStyle = {
        padding: 10,
        height: '80%', width: '100%',
        margin: "50px 110px auto",

    }
    return (
        <Grid container justify='flex-end' xs={12}>
            <div> </div>
            <Grid xs={2}><Button variant="contained" color='primary'> Add Shop </Button> </Grid>
            <Grid container  xs={12} direction="row">
                <Card className={classes.root}>
                    <div className={classes.details}>
                        <CardContent className={classes.content}>
                            <Typography component="h5" variant="h5">
                                Live From Space
                            </Typography>
                            <Typography variant="subtitle1" color="textSecondary">
                                Mac Miller
                            </Typography>
                        </CardContent>
                        <div className={classes.controls}>
                            <IconButton aria-label="previous">
                                {theme.direction === 'rtl' ? <SkipNextIcon /> : <SkipPreviousIcon />}
                            </IconButton>
                            <IconButton aria-label="play/pause">
                                <PlayArrowIcon className={classes.playIcon} />
                            </IconButton>
                            <IconButton aria-label="next">
                                {theme.direction === 'rtl' ? <SkipPreviousIcon /> : <SkipNextIcon />}
                            </IconButton>
                        </div>
                    </div>
                    <CardMedia
                        className={classes.cover}
                        image="/static/images/cards/live-from-space.jpg"
                        title="Live from space album cover"
                    />
                </Card>
            </Grid>
        </Grid>
    );
};

export default SellerDashboard;
